INSERT INTO `db_setting` VALUES (20, 'vket_antrian_mesin', '<p>Silahkan menuju loket pendaftaran dan menunggu dipanggil sesuai nomor urut antrian anda. Pendaftaran dilayani berdasarkan abjad <strong>A</strong>: 07.00-12.00 | <strong>B</strong>: 12.00-20.00 | <strong>C</strong>: 07.00-20.00.<br />\r\n<strong>PENTING*</strong> Pasien WAJIB datang paling lambat 1 (satu) jam sebelum jam praktik dokter berakhir.<br />\r\nReservasi Online : <em><strong>hospital.umm.ac.id/pendaftaran</strong></em></p>\r\n', 4, '0000-00-00 00:00:00', '2019-11-04 11:13:13', '');
